// src/pages/Home.js
import React from 'react';

function Home() {
  return (
    <div>
      <h2>Welcome to GalaxLearn</h2>
      <p>GalaxLearn is your gateway to a world of knowledge and learning. Whether you are here to advance your career, explore new hobbies, or gain new skills, we provide a platform to support your educational journey.</p>
      <p>Our mission is to make learning accessible and engaging for everyone. Join us today and start your adventure into the world of knowledge.</p>
    </div>
  );
}

export default Home;
